    .get('/users')
    .query({
        q: 'kasir',
        p: 1
    })
    .set('Accept', 'application/json')
    .set('Content-Type', 'application/json')
    .set('Authorization', 'bearer ' + token)
    .end(function (err, response) {
        expect(response.statusCode).to.be.equal(200)
